PRAGMA defer_foreign_keys=TRUE;
CREATE TABLE d1_migrations(
		id         INTEGER PRIMARY KEY AUTOINCREMENT,
		name       TEXT UNIQUE,
		applied_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP NOT NULL
);
CREATE TABLE repos (
  owner TEXT NOT NULL,
  name TEXT NOT NULL,
  full_name TEXT NOT NULL,
  category TEXT NOT NULL,
  featured INTEGER DEFAULT 0,
  
  
  stars INTEGER DEFAULT 0,
  language TEXT,
  description TEXT,
  best_score REAL DEFAULT 0,
  best_grade TEXT DEFAULT 'F',
  scores_by_llm TEXT,  
  
  updated_at TEXT,
  fetched_at TEXT,
  data_version INTEGER DEFAULT 1,
  
  
  data TEXT NOT NULL,
  
  PRIMARY KEY (owner, name)
);
DELETE FROM sqlite_sequence;
CREATE INDEX idx_repos_category ON repos(category);
CREATE INDEX idx_repos_best_score ON repos(best_score DESC);
CREATE INDEX idx_repos_featured ON repos(featured);
CREATE INDEX idx_repos_stars ON repos(stars DESC);
